const wrapper = {
  margin: "auto",
};
const inner = {
  margin: "auto",
  maxWidth: "1280px",
};

const Layout = (props) => (
  <div style={wrapper} className='margin-auto'>
    <div style={inner}>{props.children}</div>
  </div>
);

export default Layout;
